.projects__projectsParent {
  overflow: hidden;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: white;
  padding: 10vh 15px;

  .projects__content {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    row-gap: 40px;
    h1 {
      font-weight: bold;
      font-size: 56px;
      line-height: 66px;
      text-align: center;
      padding: 0px;
      margin: 0px;
    }
    .projects__logo {
      width: 50vw;
      max-width: 300px;
    }
    .projects__text {
      max-width: 950px;
      font-style: normal;
      font-weight: normal;
      font-size: 24px;
      line-height: 28px;
      text-align: center;
      color: #666666;

      @media (max-width: 600px) {
        font-size: 18px;
      }
    }

    .projects__tags {
      display: flex;
      justify-content: space-between;
      max-width: 450px;
      width: 100%;
      flex-wrap: wrap;
      row-gap: 20px;
      padding-bottom: 5px;
      margin-bottom: -25px;
      border-bottom: 1px #666666 solid;

      font-style: normal;
      font-weight: normal;
      color: #666666;

      user-select: none;
      -moz-user-select: none;
      -webkit-user-select: none;

      @media (max-width: 500px) {
        flex-wrap: wrap;
        border-bottom: none;
        justify-content: center;
        column-gap: 25px;
      }

      & div:nth-child(n) {
        cursor: pointer;
      }
      & div:nth-child(n)[active="true"] {
        border-bottom: 1px black solid;
        padding-bottom: 6px;
        margin-bottom: -6px;
        font-weight: bold;
        color: black;
      }
    }
    .projects__galleryParent {
      transition: all 250ms ease;

      &[hide="true"] {
        transition: all 250ms ease;
        transform: translateY(10px);
        opacity: 0;
      }
    }
  }
}
